import React from 'react'
import {Link} from "react-router-dom"

function Navbar() {
  return (
      <div className='navbar'>
          <div style={{left:"50px"}}>
            DIVINE
          </div>
          <div>
            <Link to='/enroll'> Join us </Link>
          </div>
      </div>
  )
}

export default Navbar ;
